import './App.css';
import {Products} from './Components/Products';

import {getProducts} from './Reducer/Action/productAction';
import {useSelector , useDispatch} from 'react-redux';


const products = {
  name: 'products',
  imgae: "asas",
  price: "2222",
  _id: "i3",
}

function App() {
  return (
    <div className="App">
      <Products products={products} />
    </div>
  );
}

export default App;
